import React from "react"

export default function Footer()
{
    return(
        <footer>
        <a className = "Foot-logo" href="#"><img  src="../src/images/Twitter-Icon.png"/ ></a>
        <a className = "Foot-logo" href="#"><img  src="./images/Facebook-Icon.png"/></a>
        <a className = "Foot-logo" href="#"><img  src="./images/Instagram-Icon.png"/></a>
        <a className = "Foot-logo" href="#"><img  src="./images/GitHub-Icon.png"/ ></a>
        </footer>
    )
}
